Comment:
Los módulos habitáculo de la tripulación tienen un error de diseño en la pelicula, lo cual los hace faltos de verosimilitud;
La fuerza gravitacional generada por la fuerza centrífuga de dichos módulos giratorios, no ubican el centro de gravedad creado en el punto correcto, como se viera en la secuencia inicial en que la protagonista se encuentra en su habitáculo y llora contra la ventana de su pared, en esa pared debería estar el suelo, pues ese es el punto de gravedad. 
A menos que exista otra explicación que desconozco, me gustaría que existiera una lógica en esta parte de la peli pues dudo que los creadores de semejante pelicula se equivocaran en ese detalle.
